    return (
      <div>
        <h1>count : {this.state.count}</h1>
        <button
          onClick={() => {
            this.handlePlusButton()
          }}
        >
          +
        </button>
        <button
          onClick={() => {
            this.handleMinusButton()
          }}
        >
          -
        </button>
      </div>
    )
  }
}

export default App
